import XCTest
@testable import GiveMeAnOffer

final class IsAnagramStringTests: XCTestCase {
    
    func testInput() {
        XCTAssertTrue("anagram".isAnagram(Of: "nagaram"))
        XCTAssertFalse("rat".isAnagram(Of: "car"))
        XCTAssertTrue(String.isAnagram("", ""))
    }
    
    static var allTests = [
        ("有效的字母异位词", testInput),
    ]
}
